// src/components/Footer.js
import React from 'react';

function Footer() {
    const footerStyle = {
        backgroundColor: '#333',
        color: '#fff',
        padding: '1rem',
        textAlign: 'center',
        position: 'fixed',
        bottom: 0,
        width: '100%'
    };

    return (
        <footer style={footerStyle}>
            <p>&copy; 2025 Mon E-commerce. Tous droits réservés.</p>
        </footer>
    );
}

export default Footer;
